import React from "react";

function About() {
    return (
        <section
            id="aboutUs"
            className="container d-flex flex-row justify-content-center justify-content-md-start align-items-between w-100 h-100"
        >
            <div className="row w-100">
                <div className="col-12 col-md-6 border">
                    <h2 className="text-white display-1 font-weight-bold">
                        Section
                    </h2>
                </div>
            </div>
        </section>
    );
}

export default About;
